import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import backendURL from '../apiConfig';

export default function ProfilePage() {
  const [user, setUser] = useState(null);
  const [locations, setLocations] = useState([]);
  const [averageRatings, setAverageRatings] = useState({});
  const [error, setError] = useState('');

  useEffect(() => {
    const storedUser = localStorage.getItem('user');
    if (storedUser) {
      try {
        const parsedUser = JSON.parse(storedUser);
        setUser(parsedUser);

        // Fetch user-created locations
        axios.get(`${backendURL}/api/locations`)
          .then(async (res) => {
            const userLocations = res.data.filter(location => location.username === parsedUser.username);
            setLocations(userLocations);

            // For each location, fetch its reviews and compute average
            const ratingPromises = userLocations.map(async (loc) => {
              try {
                const reviewRes = await axios.get(`${backendURL}/api/reviews/location/${loc._id}`);
                const reviews = reviewRes.data;
                if (reviews.length > 0) {
                  const total = reviews.reduce((sum, review) => sum + review.rating, 0);
                  const average = total / reviews.length;
                  return { id: loc._id, avg: average };
                } else {
                  return { id: loc._id, avg: null };
                }
              } catch (err) {
                console.error(`Error fetching reviews for location ${loc._id}:`, err);
                return { id: loc._id, avg: null };
              }
            });

            const ratings = await Promise.all(ratingPromises);
            const ratingsObj = {};
            ratings.forEach(r => {
              ratingsObj[r.id] = r.avg;
            });
            setAverageRatings(ratingsObj);

          })
          .catch((err) => {
            console.error('Error fetching locations:', err);
            setError('Failed to load locations.');
          });
      } catch {
        setUser(null);
      }
    }
  }, []);

  const renderStars = (rating) => {
    const stars = [];
    const roundedRating = Math.round(rating || 0);
    for (let i = 0; i < 5; i++) {
      if (i < roundedRating) {
        stars.push(<span key={i} className="text-hunter text-lg">★</span>);
      } else {
        stars.push(<span key={i} className="text-hunter text-lg">☆</span>);
      }
    }
    return stars;
  };

  return (
    <div className="min-h-screen pt-20 px-4 flex flex-col items-center bg-inherit font-inknut text-brunswick">
      <h1 className="text-4xl font-bold mb-8">My Locations</h1>

      {error && <p className="text-imperial mb-6">{error}</p>}

      {locations.length > 0 ? (
        <div className="w-full max-w-6xl overflow-x-auto">
            <div className="flex space-x-6 py-4">
            {locations.map((location) => (
                <div key={location._id} className="flex-shrink-0 w-80 bg-alabaster rounded-lg shadow-md p-6 mr-6">
                    <Link to={`/locations/${location._id}`}>
                    <h2 className="text-2xl font-bold text-fern hover:text-hunter mb-2 text-center">
                        {location.locationName}
                    </h2>

                    {/* Stars or "Not yet rated" under the location name */}
                    <div className="flex justify-center items-center mb-4">
                        {averageRatings[location._id] !== undefined && averageRatings[location._id] !== null ? (
                        renderStars(averageRatings[location._id])
                        ) : (
                        <p className="italic text-gray-500 text-sm">Not yet rated</p>
                        )}
                    </div>
                    </Link>

                    <p className="text-sm text-center mb-1"><strong>Created by:</strong> {location.username}</p>
                    <p className="text-sm text-center mb-1"><strong>Type:</strong> {location.locationType}</p>
                    <p className="text-sm text-center mb-1"><strong>Address:</strong> {location.address}</p>
                    <p className="text-sm text-center">{location.description}</p>
                </div>

            ))}
            </div>
        </div>
        ) : (
        <p>No locations created yet.</p>
        )}
    </div>
  );
}
